@OmarBousbia المجلس التأسبسي هو مجلس ينتخبه الشعب، وتكون مهمته الوحيدة هي كتابة الدستور وإختيار نظام الحكم الأصلح.
الأصل في الدساتير هي أنها وجدت لحماية حقوق الأفراد من تغول السلطة.
أما "الدستور" الذي تكتبه السلطة لنفسها وتعرضه على الإستفتاء دفعة واحدة في إنتخابات مزورة فهذا ضحك على الشعوب.
